import React from "react";
import SingleResult from "./SingleResult";
import "./SingleResult.css";

function ShowResult(props) {
  const { items, filter } = props;
  console.log(items);

  return (
    <div className="showResult">
      {items.map((item) => {
        if (
          (item.option === "Panding" && filter.pending) ||
          (item.option === "In Progress" && filter.inProgress) ||
          (item.option === "done" && filter.done)
        ) {
          return <SingleResult key={item.value} item={item} />;
        } else {
          return null;
        }
      })}
    </div>
  );
}

export default ShowResult;
